import React from "react";
import Product from "../../components/Product/ProductsP";
import Sidebar from "../../components/Product/Sidebar";

const Products = () => {
  return (
    <>
      <div class="container main-product-section mt-200">
        <Sidebar />
        <Product />
      </div>
    </>
  );
};

export default Products;
